import React, { useState, useEffect } from 'react';
import StartMenu from "./StartMenu";
import Game2048 from './2048/Game2048';

const Game = () => {

    const [start, setStart] = useState(false);

    return (
        <>
            { !start ? 
                <StartMenu setStart={setStart} />  :
                <Game2048 />

            }
        </>
    );

};

export default Game;
